import React from "react";
import NavBar from "./NavBar";
import Header from "./Header";
import About from "./About";
import Portfolio from "./Portfolio";



function App() {
    return (
        <div id="parent-div" class="parent-div">
            <NavBar />
            <Header />
            <About />
            {/* <Portfolio /> */}
        </div>
    )
}

export default App;
